import React,{ useState } from 'react'
import { CircularProgressbar } from 'react-circular-progressbar'

const CardGraph = () => {
    const percentage = 66;
    return (
        <div>
            <CircularProgressbar 
            value={percentage}
            text={`${percentage}`}/>
        </div>
    )
}

export default CardGraph
